import React from 'react'
import Button from '../UI/Button'

export default function FileSubmitForm(props) {
  return (
    <div className={props.className}>
        <form className='bg-white absolute' method="POST" onSubmit={props.fileSubmitHandler} encType="multipart/form">
            <input type="file" className='hidden' name="csv-file"></input>
            <Button type="submit" message="Import a CSV"></Button>
        </form>
    </div>
  )
}
